      }

    let handleObject = feature => {

            return '';

            return JSON.stringify(feature);
        } else {
            return feature;
        }
    }
    let fields = ["NIL", "eco_index"];

    let table = '<table>' +
        String(
        fields.map(

        `<tr>

            <td>${handleObject(layer.feature.properties[v]).toLocaleString()}</td>
        </tr>`).join(''))
    +'</table>';
    div.innerHTML=table;
    
    return div
    }

    geo_json_aae9debd27e5dc97c0874f90d55b5c05.bindTooltip(
    function(layer){
    let div = L.DomUtil.create('div');
    
    let handleObject = feature => {
        if (feature === null) {
            return '';
        } else if (typeof(feature)=='object') {
            return JSON.stringify(feature);
        } else {
            return feature;
        }
    }
    let fields = ["NIL", "liv_index"];
    let aliases = ["NIL:", "Livelihood sub-index:"];
    let table = '<table>' +
        String(
        fields.map(
        (v,i)=>
        `<tr>
            <th>${aliases[i].toLocaleString()}</th>
            
            <td>${handleObject(layer.feature.properties[v]).toLocaleString()}</td>
        </tr>`).join(''))
    +'</table>';
    div.innerHTML=table;
    
    return div
    }
